import React from 'react';
import "./index.css"


const ToDoList=(props)=>{
   

return(<><div className='list_box'>
<li className='item_name'>{props.text}</li>
<button className='delete_button' onClick={()=>{props.onSelect(props.id)}}>x</button>
</div>
</>

)
}
export default ToDoList;
